import { Component } from '@angular/core';
import { SongslistcomponentComponent } from '../songslistcomponent/songslistcomponent.component';

@Component({
  selector: 'app-myplaylistcomponent',
  templateUrl: './myplaylistcomponent.component.html',
  styleUrls: ['./myplaylistcomponent.component.css']
})
export class MyplaylistcomponentComponent {
 Playlist = 'My Playlist';
 display_playlist = 'list of songs checked';
 selectedplaylist: any='';

 playlist(message: any): void {
  this.selectedplaylist = message;
 }
}
